import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import {
  Button,
  Container,
  FormControl,
  Grid,
  Stack,
  TextField,
  Typography,
} from "@mui/material";
import { Car } from "../types";

const API_URL = "http://localhost:8080/cars";

const CarList = (): JSX.Element => {
  const [cars, setCars] = useState<Car[]>([]);

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const response = await axios.get<Car[]>(API_URL);
      setCars(response.data);
    } catch (error) {
      console.error("Error fetching cars:", error);
    }
  };

  return (
    <Stack display="flex" justifyContent="center" alignContent="center">
      <Grid
        display="flex"
        justifyContent="center"
        alignContent="center"
        alignItems="center"
      >
        <Typography variant="h4">Car List</Typography>
      </Grid>
      <Grid justifyContent="center" display="flex" alignContent="space-between">
        <Stack>
          {cars.length
            ? cars.map((car) => (
                <div key={car.id}>
                  <Link to={`/cars/${car.id}`}>
                    <Typography>{`${car.make} ${car.model} (${car.year})`}</Typography>
                  </Link>
                </div>
              ))
            : null}
        </Stack>
        <Grid>
          <FormControl sx={{ width: "25ch" }}>
            <TextField
              id="outlined-basic"
              label="Make"
              variant="standard"
              style={{ margin: 10 }}
            />
            <TextField
              id="outlined-basic"
              label="Model"
              variant="standard"
              style={{ margin: 10 }}
            />
            <TextField
              id="outlined-basic"
              label="Year"
              inputProps={{ inputMode: "numeric", pattern: "[0-9]*" }}
              variant="standard"
              style={{ margin: 10 }}
            />
            <Button variant="outlined">Submit</Button>
          </FormControl>
        </Grid>
      </Grid>
    </Stack>
  );
};

export default CarList;
